const style = {
    form: {
        margin: 50,
        padding: 10,
        width: 245,
        border: "1px solid black",
        backgroundColor: "black",
        color: "white"
    },
    inputGroup: {
        marginBottom: 10
    },
    input: {
        backgroundColor: "#EFEFFF",
        marginLeft: 10
    },
    error: {
        color: "red",
        margin: 5
    },
    img: {
        marginTop: 50,
        marginLeft: 550,
    },
    score: {
        borderRadius: 50,
    }

};

export default style;
